  false,\n\t\"url\": null,\n\t\"notes\": \"The comprehensive Greenhouse Gas (GHG)
  Emissions Inventory for the Federal Government accounts for emissions associated
  with Federal operations in FY 2010. Attached files provide summaries of the FY 2010
  aggregate Federal Government and individual agency Scope 1,2 and 3 emissions. The
  inventories are broken into two data sets: one set of GHG emissions subject to reduction
  targets, and a separate data set of military operations, law enforcement, and other
  emissions not subject to reduction targets.\",\n\t\"license_title\": null,\n\t\"extras\":
